                    dato="172,145"
                    icon="fa-chalkboard"
                    progressBar={ProgressBar}
                  >
                    <div className="progress">
                      <div className="progress-bar" style={{ width: "91%" }} />
                    </div>
                    <span className="progress-description ">91% Urbanos</span>
                  </Tarjeta>
                  <Tarjeta
                    nombre="Establecimientos"
                    dato="1,001"
                    icon="fa-building"
                  />
                  <Tarjeta
                    nombre="Cupos"
                    dato="168,583"
                    icon="fa-graduation-cap"
                  />
                  <Tarjeta
                    nombre="Postulaciones"
                    dato="79,613"
                    icon="fa-users"
                  />
                </Row>
                <Row>
                  <SectionLeft>
                    <Calendar />
                  </SectionLeft>
                  <SectionRight>
                    <Map />
                  </SectionRight>
                </Row>
                {/* /.row (main row) */}
              </Container>
              {/* /.container-fluid */}
            </section>
            {/* /.content */}
          </div>
        </div>
        <Footer />
      </div>
    );
  }
}
